import { useState } from 'react';

function UltimosLancamentos() {
    const livrosList = useState([
        { nome: 'Livro 1', src: 'imagem1.jpg' },
        { nome: 'Livro 2', src: 'imagem2.jpg' },
        { nome: 'Livro 3', src: 'imagem3.jpg' }
    ]);

    return (
        <section>
            <h2>ULTIMOS LANCAMENTOS</h2>
            {livrosList.map(livro => (
                <div key={livro.nome}>
                    <img src={livro.src} alt={livro.nome} />
                    <p>{livro.nome}</p>
                </div>
            ))}
        </section>
    );
} 

export default UltimosLancamentos;
